	clearInterval(this.stream_interval) 
    }

    send_val() { 
	var val  ; 
	switch (this.opts.mode)  { 
	case 'sin' : 
	    val  = Math.sin ( (new Date().getTime()) * this.opts.rate )
	    break  ; 
	case 'rand' : 
	    val = (this.opts.multiplier || 1 ) * Math.random() + (this.opts.offset || 0 ) 
	    break ; 
	case 'burst' : 

	    var burst = ! ( (new Date).getSeconds() % 5  )
	    if (burst ) { 
