		//console.log("burst")
		val = {x :  Math.random() + 5, y : Math.random() + 20}
	    } else { 
		//val = {x :  0.1*Math.random() + 0.5 }
		val = {x :  Math.random() + 5, y : Math.random() + 10}
	    }
	    break ;
	} 

	this.data_handler(val) 
    } 

}

